INSERT INTO `sell_files` VALUES (240373,361,92,3,3,4500,'2012-07-20 17:02:51','2013-01-21 01:18:10',1842,'2012-07-20 16:56:25',1,0,0,'',NULL,0,'\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">Cream Theme is designed for SEO and easy touch screen operation, it is based on a 1140 grid and is also visible and easy to use on small phone screens.</p>\r# Compatible with all screen sizes.&nbsp;# Easy Touch screen and mouse operations.&nbsp;\r# 3 or 4 columns layout. (One click to change) \r# Slider for up to 8 frames (can be deactivated). \r# 16 standard fonts and 500+ Google Web Fonts. \r# Google Analytics ready. \r# Google Webfonts ready. \r# 20 ready Social links with icons (SVG - Vector file included to make your own or changing the colors). \r# Localized theme: Change the Blog language, and the elements change the language.&nbsp;\r# Included languages: English, French, Italian, German, Japanese, Turkish, Spanish, Russian, Polish, Portuguese (PT), Portuguese (BR), Dutch.&nbsp;\r# SEO ready. \r# Disqus ready. Full control over colors and backgrounds.\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\"></p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\"><b>What are you doing with your hands as you view this page?</b></p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">With the unstoppable growth of smartphones and tablets, youâ€™re more likely to be tapping the screen than clicking the mouse.</p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">This theme considers both controls, the touch screen and the mouse, it can be clearly seen on the smallest mobile phone screen and a modern monitor resolution, fits without any major loss of quality.</p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">A few special features: clickable phone number in mobile phone browsers, Phonenumber as QR-code on mouse-over event in standard browsers (at top right) â€¦ all this can be turned off, if you preferred.</p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\"></p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\"><b>Tumblr and SEO</b></p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">Also some Search Engine Optimization have been made, the Tumblr method to use the Blog-description as META description changed here and has an extra field to put in this information, so you can use the Tumblr description for HTML and Java Script on the Theme.</p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">The META keywords can be also entered separately in this theme (Tumblr has normaly&nbsp;no option for this), it also uses the given tags as META keywords for each post.</p>\r\r<p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; color: rgb(34, 34, 34);\">HTML-Headings such as H1 and H2 are important for search engines, but some post-types (photo, photo sets, video and audio) do not support this in Tumblr. This theme generates this from the first words of your Blog-Entry.</p>\r\r','CreamTheme for Tumblr','ABdb',1,'/KostenpflichtigeDownloads/CreamTheme.zip','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"frete4imruty3oj\";s:6:\"secret\";s:15:\"utenofpowcj4a6g\";}',1500,1,5,0,'USD',0,NULL,0);
