INSERT INTO `sell_files` VALUES (241063,2,582,1,1,1900,'2012-09-22 16:18:19','2013-01-23 06:04:11',14833,'2012-09-25 01:07:04',1,0,0,'','page_white_compressed',0,'<p>A crossplatform&nbsp;<b>full mobile game</b>&nbsp;with all the sources teaching you how to make a Four in a Row style app using the&nbsp;<a href=\"http://www.coronalabs.com/\">Corona SDK</a>.</p>\r\r<p>Thanks to this game you will know how the best practices of coding a fully working game in CoronaSDK.</p>\r\r<p>What you find in this package:</p>\r\r<p>-&nbsp;<b>crossplatform game</b>&nbsp;working on iOS/Android/NOOK Color/Kindle Fire</p>\r\r<p>-&nbsp;<b>2 versions</b>&nbsp;of the game! Paid and Free supported by&nbsp;<a href=\"http://www.google.com/ads/admob/\">AdMob</a>&nbsp;ads</p>\r\r<p>- single player mode with&nbsp;<b>3 difficulty levels</b>.&nbsp;</p>\r\r<p>-&nbsp;<b>network multiplayer</b>&nbsp;implemented with&nbsp;<a href=\"http://www.pubnub.com/\">PubNub</a></p>\r\r<p>- all graphic sources in&nbsp;<b>layered PSD</b>&nbsp;files</p>\r\r<p>-&nbsp;<i>â€œmore gamesâ€</i>&nbsp;screen</p>\r\r<p>- sounds</p>\r\r<p>- music</p>\r\r<p>What you will learn from the sourcecode:</p>\r\r<p>- CoronaSDK OOP</p>\r\r<p>- storyboard API</p>\r\r<p>- advanced tweening with GTween</p>\r\r<p>- JSON serialization</p>\r\r<p>- saving data to file</p>\r\r<p>- proper button handling</p>\r\r<p>- dispatching events</p>\r\r<p>- PubNub multiplayer integration</p>\r\r<p>- implementing AdMob ads</p>\r\r<p>- using custom fonts</p>\r\r<p>- and more :)&nbsp;</p>\r\r<p>CoronaSDK is free to test. Just download it here:&nbsp;<a href=\"http://www.coronalabs.com\">http://www.coronalabs.com</a></p>\r','4 in a Row - mobile game with full source - iOS/Android/Nook/Kindle','ABWS',1,'/Apps/Sellbox/games/4InARow.zip','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"iu2z8zmm6dejznv\";s:6:\"secret\";s:15:\"40z85meenzbsgph\";}',1900,0,5,0,'USD',0,NULL,0);
