INSERT INTO `sell_files` VALUES (241146,1312,24,0,0,0,'2012-09-26 14:56:43','2012-10-29 20:36:45',303164,'2012-09-26 16:56:55',1,0,0,'','page_white_compressed',0,'<p><b>Information</b></p>\r\r<p>Debian 6.0.5 minimal\rGitlab 2.8 stable</p>\r\r<p>Additional packages: bash-completion, nano, fail2ban (preconfigured to block SSH hack attemps) </p>\r\r<p><b>Installation</b></p>\r\r<p>After creating a new container with the template, please follow these steps: </p>\r\r<p>1. (optional) It\'s smart to copy your public key to the container, so you can login without a password. e.g. <i>ssh-copy-id -i .ssh/id_rsa.pub root@yourcontainer</i> 2.&nbsp;(optional)&nbsp;Login to the container. If it worked without a password, run: <i>passwd -l root</i> to disable the root\'s password (secure) 3.&nbsp;(optional)&nbsp;replace <i>/etc/ssh/sshd_config</i> with <i>/etc/ssh/sshd_config.secure</i> and restart ssh (<i>/etc/init.d/ssh restart</i>) -&gt; You should now have a more or less secure system!</p>\r\r<p>4. (optional) <i>dpkg-reconfigure locales</i> 5. (optional) <i>dpkg-reconfigure tzdata</i> -&gt; optional but recommended</p>\r\r<p>6. edit <i>/etc/mailname</i> to fit your hostname 7. edit <i>/etc/hostname</i> to fit your hostname 8. edit <i>/etc/postfix/main.cf </i>-&gt; mydestination to fit your hostname -&gt; within all files, you just have to replace \"gitlab.rackster-server.ch\"</p>\r\r<p>9. change server_name in <i>/etc/nginx/nginx.conf</i> -&gt; replace \"gitlab.rackster-server.ch\"</p>\r\r<p>10. change web and email configs in <i>/home/gitlab/gitlab/config/gitlab.yml</i> -&gt; internal settings for Gitlab</p>\r\r<p>11. restart nginx (<i>/etc/init.d/nginx restart</i>) 12. restart gitlab (<i>/etc/init.d/gitlab restart</i>) 13. restart postfix (<i>/etc/init.d/postfix restart</i>) -&gt; everything should now be running fine!</p>\r\r<p><b>Credentials</b></p>\r\r<p>Default credentials used within the template. You should change at least the SSH passwords, or disable passwords with passwd -l (for user \"root\"). MySQL is more or less safe, as it only listens on localhost. </p>\r\r<p><b>SSH</b></p>\r\r<p> User: root &nbsp; Password: iecohGah8ahy2aij2yaifashei3aiy</p>\r\r<p><b>MySQL</b></p>\r\r<p>User: root &nbsp; Password: hahXooduuch6ma1eeR9Oloh4ba0eel</p>\r\r<p>User: gitlab &nbsp; Password: Howitie2aiz2ieleidoF3quohxaPh9</p>\r\r<p><b>Gitlab</b></p>\r\r<p>User: admin@local.host &nbsp; Password: 5iveL!fe</p>\r\r<p><b>Support</b></p>\r\r<p>If you have problems, feel free to contact me.</p>\r','Gitlab 2.8 | Debian 6.0.5 OpenVZ Template','AB4Y',0,'/gitlab-openvz-template/debian-6.0-amd64-gitlab-2.8.tar.gz','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"7qq5d2oiivfnv2t\";s:6:\"secret\";s:15:\"kg33d7yro7xv1ux\";}',0,1,5,0,'EUR',0,'Access token is disabled.',0);
