INSERT INTO `sell_files` VALUES (241149,1312,44,0,0,0,'2012-09-26 18:52:15','2012-11-06 16:34:26',310193,'2012-09-26 17:49:38',1,0,0,'','page_white_compressed',0,'<p><b>Information</b></p>\r\r<p>Debian 6.0.5 minimal\rGitlab 2.9 stable</p>\r\r<p>Additional packages: bash-completion, nano, fail2ban (preconfigured to block SSH hack attemps)</p>\r\r<p><b>Installation</b></p>\r\r<p>After creating a new container with the template, please follow these steps:</p>\r\r<p>1. (optional) It\'s smart to copy your public key to the container, so you can login without a password. e.g.&nbsp;<i>ssh-copy-id -i .ssh/id_rsa.pub root@yourcontainer\r</i>2.&nbsp;(optional)&nbsp;Login to the container. If it worked without a password, run:&nbsp;<i>passwd -l root</i>&nbsp;to disable the root\'s password (secure)\r3.&nbsp;(optional)&nbsp;replace&nbsp;<i>/etc/ssh/sshd_config</i>&nbsp;with&nbsp;<i>/etc/ssh/sshd_config.secure</i>&nbsp;and restart ssh (<i>/etc/init.d/ssh restart</i>)\r-&gt; You should now have a more or less secure system!</p>\r\r<p>4. (optional)&nbsp;<i>dpkg-reconfigure locales\r</i>5. (optional)&nbsp;<i>dpkg-reconfigure tzdata\r</i>-&gt; optional but recommended</p>\r\r<p>6. edit&nbsp;<i>/etc/mailname</i>&nbsp;to fit your hostname\r7. edit&nbsp;<i>/etc/hostname</i>&nbsp;to fit your hostname\r8. edit&nbsp;<i>/etc/postfix/main.cf&nbsp;</i>-&gt; mydestination to fit your hostname\r-&gt; within all files, you just have to replace \"gitlab.rackster-server.ch\"</p>\r\r<p>9. change server_name in&nbsp;<i>/etc/nginx/nginx.conf \r-</i>&gt; replace \"gitlab.rackster-server.ch\"</p>\r\r<p>10. change web and email configs in&nbsp;<i>/home/gitlab/gitlab/config/gitlab.yml\r</i>-&gt; internal settings for Gitlab</p>\r\r<p>11. restart nginx (<i>/etc/init.d/nginx restart</i>)\r12. restart gitlab (<i>/etc/init.d/gitlab restart</i>)\r13. restart postfix (<i>/etc/init.d/postfix restart</i>)\r-&gt; everything should now be running fine!</p>\r\r<p><b>Credentials</b></p>\r\r<p>Default credentials used within the template. You should change at least the SSH passwords, or disable passwords with passwd -l (for user \"root\"). MySQL is more or less safe, as it only listens on localhost.</p>\r\r<p><b>SSH</b></p>\r\r<p>User: root\rPassword: iecohGah8ahy2aij2yaifashei3aiy</p>\r\r<p><b>MySQL</b></p>\r\r<p>User: root\rPassword: hahXooduuch6ma1eeR9Oloh4ba0eel</p>\r\r<p>User: gitlab\rPassword: Howitie2aiz2ieleidoF3quohxaPh9</p>\r\r<p><b>Gitlab</b></p>\r\r<p>User: admin@local.host\rPassword: 5iveL!fe</p>\r\r<p><b>Support</b></p>\r\r<p>If you have problems, feel free to contact me.</p>\r','Gitlab 2.9 | Debian 6.0.5 OpenVZ Template','AB4o',0,'/gitlab-openvz-template/debian-6.0-amd64-gitlab-2.9.tar.gz','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"21qtkg411kkelh2\";s:6:\"secret\";s:15:\"x4qugv4a7ycsnaf\";}',0,1,5,0,'EUR',0,'Access token is disabled.',0);
