INSERT INTO `sell_files` VALUES (241842,2048,65,0,0,0,'2012-10-21 04:06:12','2013-01-20 04:57:18',841,'2012-10-18 00:27:07',1,0,0,'','page_white_acrobat',0,'\r<p>It\'s not the tool, it\'s the writer. If your words aren\'t true, if they aren\'t accurate, or if they\'re not chosen properly then the finest software, service, or device won\'t make you a better writer.Having said that, a good piece of software or a good service or a good device can make you a more efficient and more flexible writer. Google Drive fits that bill. It lets you work anywhere and with anyone. Using Google Drive, you can work more efficiently and get more writing done.</p>\r\r<p><i>Google Drive for Writers</i> guides you through a number of useful features and functions of Google Drive. You\'ll go beyond the basics and learn how to use Google Drive not (just) as a word processor but as a powerful tool for writing, submitting that writing to editors, and collaborating with others. You\'ll also discover how to easily and efficiently organize and back up your work.</p>\r\r<p>While <i>Google Drive for Writers</i> was put together with writers in mind, you don\'t need to be one to take advantage of the information on its pages. Whether you\'re a writer, a student, a users of Google Apps for Business, a small business owner, or just someone who wants or needs to put information down on a page, you\'ll find something useful in this book. </p>\r\r<p>You can view the book\'s&nbsp;<a href=\"http://scottnesbitt.net/ebooks/Google_Drive/ToC-Google_Drive.pdf\">table of contents</a>&nbsp;or a&nbsp;<a href=\"http://scottnesbitt.net/ebooks/Google_Drive/Google_Drive-Sample_Chapter.pdf\">sample chapter</a>&nbsp;on my website before you decide to buy.</p>\r','Google Drive for Writers','AB7y',1,'/ebooks - Completed/Google Drive for Writers/published/Google Drive for Writers.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"8wpd4iz4zqote41\";s:6:\"secret\";s:15:\"l9zrhwcq4y253o8\";}',599,0,5,0,'USD',0,NULL,0);
INSERT INTO `sell_files` VALUES (241843,2048,54,0,0,0,'2012-10-21 04:13:01','2013-01-21 11:24:01',104,'2012-04-24 02:14:36',1,0,0,'','page_white_acrobat',0,'\r<p>This little book tells two tales of perception. Like many young people after they graduate from university, I traveled to Japan in the early 1990s. My reasons for moving to the other side of the world were many, but mainly I needed a change. Little did I realize what a change that would be.The two years in which I lived in Japan were definitely a time of change. Both for the country and for myself.&nbsp;</p>\r\r<p>When I stepped off the plane at Osaka\'s Itami Airport at the end of May, 1990, the Japanese economic miracle was on the cusp of turning sour. The heady bubble years, in which Japan seemed to be an unstoppable economic and technological powerhouse, were coming to a close. I witnessed the beginnings of the country\'s transition from the <i>Japan That Can Say No</i> to the nation that\'s sadly still in the throes of economic stagnation.</p>\r\r<p>The pair of essays that make up <i>Two Views of Japan</i> show two sides of my perception of the country after having spent first about a year and then two there. During that time my position didn\'t shift much but my perspective and perceptions changed dramatically. These essays chronicle a personal journey, one of both disillusion and loneliness and of growth.</p>\r\r<p>If there a lesson in this book, it\'s that no matter where you are and what you think you know, you can always learn more. Not just about a place or a space in time but about yourself. </p>\r','Two Views of Japan','AB7P',1,'/ebooks - Completed/Japan Essays/published/Two Views of Japan.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"8wpd4iz4zqote41\";s:6:\"secret\";s:15:\"l9zrhwcq4y253o8\";}',299,0,5,0,'USD',0,NULL,0);
INSERT INTO `sell_files` VALUES (241844,2048,69,0,0,0,'2012-10-21 04:29:15','2013-01-23 08:03:51',133,'2012-04-24 02:14:46',1,0,0,'','page_white_acrobat',0,'<p>These days, it seems that the once blurry line dividing our personal and professional lives has disappeared. It\'s become increasingly difficult to juggle everything -- what we need to do or where we need to be, and when we need to get those things done</p>\r\r<p>I understand where you\'re coming from. I\'m a freelance writer and I run my own business. But I\'m also a husband and the father. I have to constantly keep on top of those obligations, and many more. No doubt that you\'re in a similar boat.</p>\r\r<p>There are a lot of systems and techniques and tools that claim to help you get organized and become more productive. The problem is that most of those systems are too complex. The tools don\'t easily fit together. You wind up with a way of doing things that might work, but which is also convoluted and difficult to maintain.</p>\r\r<p>You need to keep things simple. An effective way to do just that is to use Google\'s tools to help you get and stay organized.</p>\r\r<p><i>Getting Organized with Google\'s Tools</i> explains how to use four of Google\'s Web-based tools -- Tasks, Calendar, Drive, and Gmail -- to keep on track and productive. All with a minimum of set up and maintenance.</p>\r\r<p>But <i>Getting Organized with Google\'s Tools</i> goes beyond simply showing you how to use the tools. The book contains a number of techniques and tips that can help you streamline your efforts to become more organized and to maximize your productivity. You can use these techniques and tips with any software or service that you use, not just Google.</p>\r\r<p>Best of all, you don\'t need to learn any new terminology. There are no complex workflows that you need to shoehorn into your life. There are no expensive subscriptions or additional extras needed.</p>\r\r<p>You can view the book\'s&nbsp;<a href=\"http://scottnesbitt.net/ebooks/Google_Tools/ToC-Google_Tools.pdf\">table of contents</a>&nbsp;or a&nbsp;<a href=\"http://scottnesbitt.net/ebooks/Google_Tools/GoogleTools_SampleChapter.pdf\">sample chapter</a>&nbsp;on my website before you decide to buy.</p>\r','Getting Organized with Google Tools','AB7Q',1,'/ebooks - Completed/Google Tools/published/Getting Organized with Google Tools.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"8wpd4iz4zqote41\";s:6:\"secret\";s:15:\"l9zrhwcq4y253o8\";}',299,0,5,0,'USD',0,NULL,0);
