INSERT INTO `sell_files` VALUES (241954,2124,5,0,0,0,'2012-10-28 22:33:38','2013-01-22 00:45:04',61760,'2012-10-28 22:29:41',1,0,0,'','page_white_acrobat',0,'\r<p>The first volume in the 21st Century Law Practice Series, <b style=\"font-style: italic; \">the ipad, the cloud + ethics </b>(by&nbsp;<a href=\"http://www.ilawpractice.com/#!Bio|c7f8\"><i>Caitlin Moon</i></a>,&nbsp;May 2012, 52 pages)&nbsp;considers the most relevant and game-changing primary technology for lawyers today.&nbsp;</p>\r\r<p>In <b>Section I</b>, we consider 60+ iPad apps that can make a significant difference in how (and where) you practice, and generally improve your quality of work life.&nbsp;</p>\r\r<p>In <b>Section II</b>, we consider the crucial cloud technologies you should consider integrating into your practice - how they work, why they work for lawyers, where to find them, and how to use them.&nbsp;</p>\r\r<p>In <b>Section III</b>, we consider how one can and should organize a 21st century practice, given the plethora of technology. Organization exists separate and apart from the technology. The tech tools are important, but without a system, tech won\'t move your practice forward. We also take a look at the current ethical environment, considering what guidance exists for lawyers using cloud technology in their practices.&nbsp;</p>\r\r<p>All sections include hotlinks to the information and websites referenced, for ease of access.</p>\r','21st Century Law Practice eBook','A6Aw',0,'/21st Century Law Practice eBook.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"w6kehobjt45uknb\";s:6:\"secret\";s:15:\"fowcsdv6tlpyawv\";}',2000,0,5,0,'USD',0,NULL,0);
