INSERT INTO `sell_files` VALUES (242002,2175,175,3,4,300,'2012-10-31 18:31:53','2013-01-23 05:36:55',6,'2012-10-31 18:31:44',1,0,0,'','page_white_flash',0,'\r<p><b>Ahead Full!</b></p>\r\r<p>This is a jam game I made in 1 hour, whilst aboard&nbsp;BC Ferries in May of 2011. Exclusive sale! Only available here! Never before released!</p>\r\r<p>This is a minimalist gaming experience in which you must prove your knowledge of visually judging fractions.</p>\r\r<p>Use your imagination to fill in the gaps, pretend you are a captain at sea or perhaps in a space ship!</p>\r\r<p>(Game is provided as an .SWF file, should run in any flash-enabled browser automatically)</p>\r\r<p>Here\'s a blog post detailing the events surrounding development, along with a nice video:&nbsp;<a href=\"http://www.andymoore.ca/2011/05/fullindie-meet-in-vancouver-plus-ferryjam/\">http://www.andymoore.ca/2011/05/fullindie-meet-in-vancouver-plus-ferryjam/</a></p>\r','Ahead Full!','A6jZ',1,'/SellBox/AheadFull.swf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"qoohvgz36hhouwh\";s:6:\"secret\";s:15:\"ale9v0eqd56ihzg\";}',100,1,5,0,'USD',0,NULL,0);
