INSERT INTO `sell_files` VALUES (242278,2300,35,0,11,0,'2012-11-20 04:36:41','2013-01-22 18:50:09',1873,'2012-11-20 04:22:03',1,0,0,'','page_white_acrobat',0,'<p>If I\'ve learned one thing since starting this voyage, it\'s that the R/C hobby is complex. There are many new terms that need to be learned, mechanical attributes that need to be understood, and a world-wide community that\'s&nbsp;available&nbsp;to help you out, should you need it.</p>\r\r<p>I wanted to&nbsp;commemorate&nbsp;my nearly year-long adventure as an RC Newb by giving back to that community, and I\'ve done so by creating an ebook. &nbsp;This book, <a href=\"http://sbx.sk/A6De\">A Newbie\'s Guide to Hobby-grade R/C Vehicles</a> is written by a beginner, for beginners (or people that know folks that might want to get into the hobby). &nbsp;It\'s a quick read (less than 20 pages) and gives a high-level overview of the hobby and what\'s involved in it.</p>\r\r<p>I\'m introducing it as a free ebook, but donations are accepted (should you be so-inclined). Thanks and happy reading!&nbsp;</p>\r','A Newbieâ€™s Guide to Hobby-grade R/C Vehicles','A6DW',1,'/Clients/RC Newb/eBooks/A Newbieâ€™s Guide to Hobby-grade R:C Vehicles.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"8p5dkujk4aisj6w\";s:6:\"secret\";s:15:\"o30snymxus61kow\";}',0,1,5,0,'USD',0,NULL,0);
