INSERT INTO `sell_files` VALUES (242377,2487,1,0,0,0,'2012-11-25 17:39:01','2012-11-25 17:42:04',43666,'2012-08-10 18:29:33',1,0,0,'','page_white_acrobat',0,'<p>STATISTICAL METHODS FOR PSYCHOLOGY surveys the statistical techniques commonly used in the behavioral and social sciences, especially psychology and education. To help students gain a better understanding of the specific statistical hypothesis tests that are covered throughout the text, author David Howell emphasize conceptual understanding. Along with a significantly updated discussion of effect sizes and examples on how to write up the results of data analysis, this Sixth Edition continues to focus students on two key themes that are the cornerstones of this book\'s success: the importance of looking at the data before beginning a hypothesis test, and the importance of knowing the relationship between the statistical test in use and the theoretical questions being asked by the experiment.\r</p>\r','Statistical methods for psychology','A68u',1,'/Tulane/TEXTBOOKS/Statistical methods for psychology.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"1lpff0lfyc8p2t9\";s:6:\"secret\";s:15:\"w9v7dkct94msrou\";}',500,1,5,0,'USD',0,NULL,0);
