INSERT INTO `sell_files` VALUES (242790,2819,0,0,0,0,'2012-12-26 23:51:17','2012-12-26 23:51:17',7035,'2012-12-26 23:51:20',1,0,0,'','page_white_compressed',0,'<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0);\">This software is designed to be easy to use. It is contained within a single executable file that is one&nbsp;<a href=\"http://en.wikipedia.org/wiki/Megabyte\" style=\"color: rgb(11, 0, 128);\">megabyte</a>&nbsp;in size. The program features a&nbsp;<a href=\"http://en.wikipedia.org/wiki/DeCSS\" style=\"color: rgb(11, 0, 128);\">DeCSS</a>&nbsp;decryption&nbsp;<a href=\"http://en.wikipedia.org/wiki/Algorithm\" style=\"color: rgb(11, 0, 128);\">algorithm</a>&nbsp;and a&nbsp;<a href=\"http://en.wikipedia.org/wiki/VBR\" style=\"color: rgb(11, 0, 128);\">VBR</a>&nbsp;<a href=\"http://en.wikipedia.org/wiki/Encoder\" style=\"color: rgb(11, 0, 128);\">encoder</a>. The user is able to choose how the compression is to be distributed across the DVD. Software can automatically re-compress video, to as little as 39% of its original size, depending on the aspect ratio&nbsp;of the original DVD (with a corresponding loss in quality) to allow it to fit on a standard&nbsp;<a href=\"http://en.wikipedia.org/wiki/DVD%C2%B1R\" style=\"color: rgb(11, 0, 128);\">DVDÂ±R(W)</a>, a&nbsp;<a href=\"http://en.wikipedia.org/wiki/DVD%2BR_DL\" style=\"color: rgb(11, 0, 128);\">Dual-Layer DVD+R</a>, or any user-defined custom size. When \"Deep Analysis\" and \"Adaptive Error Compensation\" options are selected, the quality of the resulting DVD is improved. These options are more time-consuming because it allows the software to run through the DVD once doing the analysis, and then again doing the transcoding. The transcoder in the software was unusual at the time of its release in that it employs compressed domain video processing technology to avoid a full decode and re-encode of the video stream. This boosts performance significantly as only part of the video stream is decoded and scraped.</p>\r\r<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0);\">Operates in two main modes, \"Reauthor\" and \"Full Disk\".</p>\r','DVD RE-Authoring Software','A6ZE',1,'/Downloaders and Rippers/DVD Re-Authoring/DVD RE-Authoring.rar','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"zrwyk1f8jqivx61\";s:6:\"secret\";s:15:\"5eebmb2c8s8hbvj\";}',399,0,5,0,'USD',0,NULL,0);
