INSERT INTO `sell_files` VALUES (242843,306,2,0,0,0,'2013-01-04 12:09:11','2013-01-08 20:22:24',0,'1970-01-01 00:00:00',1,0,0,'',NULL,0,'<p><b>This is not any ordinary devotional book.</b> It was written with the express intent of preaching Jesus Christ. Nothing more and nothing less. It seems to me that it is much more popular to talk about church growth, revival, leadership or social justice than about Christ Himself. I hope that this devotional is different.To be a benchwarmer on Sunday morning is not enough for people who have not yet found Christ, and it shouldnâ€™t be acceptable for those who have found Him. Studies show there is little, if any, difference between Christians and non-Christians regarding addictions, divorce, depression, volunteering, or giving. This is something that deeply concerns me. Why? Because there is a vast world of difference between the number of people who profess faith in Jesus Christ, over 1.5 billion people, and the lack of impact on the moral, spiritual and political climate of today.We need Jesus Christ more than we can possibly imagine. We can gain all the knowledge in the world, but without Jesus in our lives, there will be little fruit and barely any transformation. Hereâ€™s a crazy truth: if youâ€™re a believer in the Son of God, Christ lives inside of you. Iâ€™m convinced He speaks to us as well. But are we listening to Him?&nbsp;Over the next month, Iâ€™ll be talking a lot about Jesus. I hope that is ok with you! I pray that you fall even deeper in love with Jesus. I pray that you may discover an even greater passion to love Him, worship Him, converse with Him and serve Him!&nbsp;Each day has questions and challenges to complete. Consider this your daily homework. I implore you to takes these questions and challenges seriously. If you do, I can guarantee your spiritual life will be flourishing and youâ€™ll be a different person because of it.Get social with it! Tweet or post across your social networks with the hash tag #JesusIsKing and invite your friends to join this journey with you!With love and grace,Ryan Drake\r</p>\r','Jesus Is King','A6oj',1,'/Jesus Is King - Ryan Drake.pdf','+4 hours',NULL,0,'dropbox','a:2:{s:3:\"key\";s:15:\"3hwxaosfat2bixf\";s:6:\"secret\";s:15:\"4w7r22nqi58w346\";}',500,0,5,0,'USD',0,NULL,0);
