INSERT INTO `sell_files` VALUES (242983,2989,1,0,0,0,'2013-01-22 14:28:05','2013-01-22 14:35:10',54293,'2011-10-16 16:03:31',1,0,0,'','application/pdf',0,'<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0);\"><i><b>Codex Seraphinianus</b></i>, originally published in 1981, is an illustrated&nbsp;encyclopedia&nbsp;of an imaginary world, created by the Italian artist, architect and industrial designer&nbsp;<a href=\"http://en.wikipedia.org/wiki/Luigi_Serafini;color: rgb(11, 0, 128);\">Luigi Serafini</a>&nbsp;during thirty months, from 1976 to 1978.&nbsp;The book is approximately 360 pages long (depending on edition), and written in a strange, generally unintelligible alphabet.</p>\r\r<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0);\">Originally published in&nbsp;Italy, the book has since been released in a number of different countries.</p>\r\r<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0);\">The word \"Codex\" in the title means \"book\" (from Latin&nbsp;<i>caudex</i>), and \"Seraphinianus\" is derived from the author\'s last name, Serafini. (In Italian,&nbsp;<i>serafini</i>&nbsp;refers to the&nbsp;seraphs.)</p>\r','Codex Seraphinianus','A6ez',1,'0BxC7tg-06ua4YTU1MTE2MDgtNWExZS00MWE0LWE4OWEtZGQ4YjBlMzdjYWNj/Codex Seraphinianus','+4 hours',NULL,0,'google_drive','{\"access_token\":\"ya29.AHES6ZSt2XM2oQ9xCEFoscGQVFX9PvQb--KcYGcP1wipih2V6Otw_Q\",\"token_type\":\"Bearer\",\"expires_in\":3600,\"id_token\":\"eyJhbGciOiJSUzI1NiIsImtpZCI6IjQxYWRlZGViNzc1MjZmMmJkMzk2NzExYmRlODNmMmIzNmQzZTFkNTAifQ..BfnHruzEvw8o0Jx788SEoPdCW3VoUvQrHburnHZjFbBWczHFZjuicK8ZjX9O6_4DX-BvK8xsT0LwoiPuPrxrC-KYeaB3PRdjv64Lkf27a-58mMdSkGzSt3QnA8BoUzANKqJ1husfyQ3NE49uL1cz0PIddv8S9QLgHRigyFqjRzY\",\"refresh_token\":\"1\\/ODp7yeLKUdsWzRkycUkSZsEPChIyrDfTtfGG-gPy3EY\",\"created\":1358864848}',499,0,5,0,'USD',0,NULL,0);
